public void test_getNumber() {
		// x, y is the first element.
	int x = 0, y = 0;
	gameCore.resetGame();
	int value = gameCore.getNumber(x, y);
	if (value < 0) {
		fail();
	}
	// y out of boundary
	x = 0;
	y = 5;
	value = gameCore.getNumber(x, y);
	assertEquals(-1, value);
	// x out of boundary
	x = 5;
	y = 0;
	value = gameCore.getNumber(x, y);
	assertEquals(-1, value);

	// x and y within ROWS and COLS range
	x = 2;
	y = 3;
	value = gameCore.getNumber(x, y);
	if (value < 0) {
		fail();
	}
}

