    assertTrue(closer(-10, 5, 1) == -9);
    assertTrue(closer(-10, 5, 2) == -8);
    assertTrue(closer(1, 2, 5) == 2);
    assertTrue(closer(-1, 1, 1) == 0);
    assertTrue(closer(0, 0, 1) == 0);

}

