    GL11.glPushMatrix();
    GL11.glTranslatef(x, y, 0);
    GL11.glBegin(GL11.GL_QUADS);
    float dist = 1f / numtiles;

    float tileSize=16f;

    GL11.glTexCoord2f(col*dist, dist*(row+1));
    GL11.glVertex2f(0, 0);
    GL11.glTexCoord2f(dist+(col*dist), dist*(row+1));
    GL11.glVertex2f(tileSize, 0);
