InternalDecTreeNode(String _label, Attribute _attribute, String _parentAttributeValue, List<DecTreeNode> _children) {
	super(_label, _attribute.category.getName(), _parentAttributeValue, false);
	this.attribute = _attribute;
	this.children = _children;
}

public void returnChild(int index, DecTreeNode child) {
	children.add(index, child);
}

public void removeChild(DecTreeNode child) {
	children.remove(child);
}

public String classify(Instance example) {
	String childExampleAttributeValue = example.attributes.get(attribute.index);
	for (DecTreeNode childNode : children) {
		if(childExampleAttributeValue.equals(childNode.parentAttributeValue)) {
			if(childNode instanceof InternalDecTreeNode) {
				return ((InternalDecTreeNode)childNode).classify(example);
			} else {
				return childNode.label;
			}					
		}
	}
	return label;
}

DecTreeNode(String _label, String _attribute, String _parentAttributeValue, boolean _terminal) {
	label = _label;
	attribute = _attribute;
	parentAttributeValue = _parentAttributeValue;
	terminal = _terminal;
	if (_terminal) {
		children = null;
	} else {
		children = new ArrayList<DecTreeNode>();
	}
}

public void addChild(DecTreeNode child) {
	if (children != null) {
		children.add(child);
	}
}

public void print(int k) {
	StringBuilder sb = new StringBuilder();
	for (int i = 0; i < k; i++) {
		sb.append("    ");
	}
	sb.append(parentAttributeValue);
	if (terminal) {
		sb.append(" (" + label + ")");
		System.out.println(sb.toString());
	} else {
		sb.append(" {" + attribute + "?}");
		System.out.println(sb.toString());
		for(DecTreeNode child: children) {
			child.print(k+1);
		}
	}
}

LeafDecTreeNode(String _label, String _parentAttributeValue) {
	super(_label, "", _parentAttributeValue, true);
}

