public int isHandBig(int[] hand){
	int sum = 0;
	for(int i=0;i<hand.length;i++){
		sum+=hand[i];
	}

	if((sum/hand.length)>=8){
		return 1;
	}
	return 0;
}

public  int[] sort(int[] hand){
	int tmp;
	for(int i=0;i<hand.length;i++){
		for(int j=hand.length-1;j>i;j--){
			if(hand[j]>hand[j-1]){
				tmp = hand[j];
				hand[j] = hand[j-1];
				hand[j-1] = tmp;
			}
		}
	}
	return hand;
}

public int minBigger(int [] hand, int card){
	int index = -1;
	for(int i=0;i<hand.length;i++){
		if(hand[i]>card){
			index = i;
		}
	}
	if(index>=0){
		return index;
	}
	return hand.length-1;
}

public int secondBigger(int [] hand){
	if(hand.length==0){
		return -1;
	}
	if(hand.length<=2){
		return 0;
	}
	else{
		return 1;
	}
}

