public static PGPoolingDataSource getInstance() {
	if (source == null) {
		synchronized (PostgreSQLPooledConnection.class) {
			if (source == null) {
				source = new PGPoolingDataSource();
				source.setDataSourceName("PGSQLDataSource");
				source.setServerName("localhost");
				source.setDatabaseName("postgres");
				source.setUser("postgres");
				source.setPassword("123456");
				source.setMaxConnections(20);
			}
		}
	}
	return source;
}

public Connection getConnection(Boolean commit) {
	try {
		conn = PostgreSQLPooledConnection.getInstance().getConnection();
		if (commit)
			conn.setAutoCommit(true);
		else
			conn.setAutoCommit(false);
	} catch (SQLException e) {
		e.printStackTrace();
	}
	return conn;
}

public void closeConnection() {
	try {
		conn.close();
	} catch (SQLException e) {
		e.printStackTrace();
	}
}

