public RSA(long a, long b ,boolean fix){
	if(fix){
		this.a = a;
		this.b = b;
	}else{
		this.a = prime(a);
		this.b = prime(b);
	}

	n = this.a * this.b;
	m = (this.a - 1)*(this.b - 1);
	e = coprime(m);
	d = modulo_inverse(e, m);

	Debug.print("n is "+n);
	Debug.print("m is "+m);
	Debug.print("e is "+e);
	Debug.print("d is "+d);

}

public long crack(long input){
	long root = (long) Math.sqrt((double)input);
	for(long i = 2; i < root; i++){
		if(input % i == 0){
			return input / i;
		}
	}
	return 0;
}

public String getcypher(String input){
	StringBuffer output = new StringBuffer();
	for(int i = 0; i < input.length(); i++){
		output.append(endecrypt(input.charAt(i), e, n));
		output.append(' ');
	}
	return output.toString();
}

public String decypher(String input){
	String[] cyphers = input.split(" ");
	StringBuffer sb = new StringBuffer();
	for(int i= 0; i < cyphers.length; i++){
		long num = Long.parseLong(cyphers[i]);
		long temp = endecrypt(num, d, n);
		Debug.print("temp is:"+temp);
		char c = (char)temp;
		sb.append(c);
	}
	return sb.toString();
}

public long prime(long n){
	long start = 2;
	n--;
	while(n > 0){
		start++;
		if(isPrime(start)){
			n --;
		}

	}
	return start;
}

public static boolean isPrime(long a){
	long root = (long) Math.sqrt((double)a);
	for(int i = 2; i <= root; i++){
		if(a % i == 0){
			return false;
		}

	}
	return true;

}

public long endecrypt(long msg, long key, long c){
	Debug.print(msg+" key:"+key+"c:"+c);
	return modulo(msg, key, c);
}

	public static long coprime(long x){
		long a = Math.abs(new Random().nextLong()) % x;
//		a = Math.abs(a);
		if(a == 0){
			a++;
		}
		while(GCD(a, x) != 1){
			a = Math.abs(new Random().nextLong()) % x;
//			a = Math.abs(a);
		}
		return a;
	}

public static long GCD(long a, long b){
	if(b > a){
		long c = b; 
		b = a;
		a = c;
	}
	if(b == 0){
		return a;
	}else{
		return GCD(b, a % b);
	}
}

public static long modulo(long a, long b, long c){
	BigInteger biA = new BigInteger(a+"");
	BigInteger biB = new BigInteger(b+"");
	BigInteger biC = new BigInteger(c+"");

	return biA.modPow(biB, biC).longValue();

}

public static long modulo_inverse(long base, long m){
	long orgM = m;
	long orgBase = base;
	long gcd = GCD(base, m);
	long x = 0;
	long lastX = 1;
	long y = 1;
	long lastY = 0;
	long quotient, tempM,tempX,tempY;
	while(m != 0){
		quotient = base / m;
		tempM = m;
		m = base % m;
		base = tempM;
		tempX = x;
		x = lastX - (quotient * x);
		lastX = tempX;
		tempY = y;
		y = lastY - quotient * y;
		lastY = tempY;
	}
	if(gcd > 1){
		return 0;
	}else{
		Debug.print("lastX:"+lastX+"lastY"+lastY);
		if(lastX > 0){
			return lastX % orgM;
		}else{
			return orgM+(lastX % orgM);
		}
	}
}

