private boolean isPrime() {

    for(long i = 2; i < Math.sqrt(n);++i) {
        if(n%i == 0) return false;
    }
   return true;
}

public Key bruteForceCrack() {

    if(isPrime()) {
        return null;
    }
    else {
        crackedKey = new Key(this.n,this.e);
        factorizeN();
        return crackedKey;
    }
}

private void factorizeN() {
    for(long i = 2; i < Math.sqrt(n);++i) {
        if(n%i == 0) {
            long factor1 = i;
            long factor2 = n/i;
            crackedKey.setM((factor1 - 1) * (factor2 - 1));
            crackedKey.setDecryptKey(modulo_inverse(this.e,crackedKey.getM()));
            break;
        }
    }
}

private long GCD(long a, long b){
    if(b > a){
        long c = b; 
        b = a;
        a = c;
    }
    if(b == 0){
        return a;
    }else{
        return GCD(b, a % b);
    }
}

private long modulo_inverse(long base, long m){
    long orgM = m;
    long orgBase = base;
    long gcd = GCD(base, m);
    long x = 0;
    long lastX = 1;
    long y = 1;
    long lastY = 0;
    long quotient, tempM,tempX,tempY;
    while(m != 0){
        quotient = base / m;
        tempM = m;
        m = base % m;
        base = tempM;
        tempX = x;
        x = lastX - (quotient * x);
        lastX = tempX;
        tempY = y;
        y = lastY - quotient * y;
        lastY = tempY;
    }
    if(gcd > 1){
        return 0;
    }else{
        Debug.print("lastX:"+lastX+"lastY"+lastY);
        if(lastX > 0){
            return lastX % orgM;
        }else{
            return orgM+(lastX % orgM);
        }
    }
}

