public static int nthOccurrence(String str, char c, int n) {
	int pos = str.indexOf(c, 0);
	while (n-- > 0 && pos != -1)
		pos = str.indexOf(c, pos+1);
	return pos;
}

private void addFiles(File file) {
	if (!file.exists()) {
		System.out.println(file + " does not exist.");
	}
	if (file.isDirectory()) {
		for (File f : file.listFiles()) {
			addFiles(f);
		}
	} else {
		queue.add(file);
	}
}

