public Bullet(float[] location, float rotation, float range, List<Obj> inst)
{
	width = 2f;
	hieght = 10f;

	points = makePoints(location, rotation);
	shape = new Polygon(points);
	this.rotation = rotation;
	this.range = range;
	speed = 30f;

