public static int[] bubbleSort(int[] arr){
	boolean flag = true;
	int n = arr.length;
	while(flag){
		for(int i=1; i<n; i++){
			if(arr[i-1] > arr[i]){
				int tmp = arr[i-1];
				arr[i-1] = arr[i];
				arr[i] = tmp;
			}
		}
		n--;
		if(n==1){
			flag=false;
		}
	}
	return arr;
}

