public Noppa(){
	value=1;
	lukitus = false;
	setImage();
}

protected Image getImage(){
	return img;
}

private void setImage() {
	if (lukitus==false){
		if(value==1){
			img=open1;
		}
		else if(value==2){
			img=open2;
		}
		else if(value==3){
			img=open3;
		}
		else if(value==4){
			img=open4;
		}
		else if(value==5){
			img=open5;
		}
		else if(value==6){
			img=open6;
		}
	}
	else if (lukitus==true){
		if(value==1){
			img=locked1;
		}
		else if(value==2){
			img=locked2;
		}
		else if(value==3){
			img=locked3;
		}
		else if(value==4){
			img=locked4;
		}
		else if(value==5){
			img=locked5;
		}
		else if(value==6){
			img=locked6;
		}
	}
}

public int getValue(){
	return value;
}

public boolean getLukitus(){
	return lukitus;
}

public void lock(){
	lukitus = !lukitus;
	setImage();
}

public void unlock(){
	lukitus=false;
	setImage();
}

public void heita(){
	if(!lukitus){
		value=rnd.nextInt(6)+1; //arpoo numeron 1-6
	}
	setImage();
}

public int compareTo(Noppa arg0) {
	return value-arg0.getValue();
}

