public Jatsikasi(){
	nopat = new Noppa[5];
	for(int i=0; i<5; i++){
		nopat[i]=new Noppa();
	}
}

protected Jatsikasi(Jatsikasi k){
	nopat = k.getNopat();
}

protected Jatsikasi(Noppa[] n){
	nopat=n;
}

public void heita(){
	for(int i=0; i<nopat.length; i++){
		if (nopat[i].getLukitus()==false){ // Jos noppaa ei ole lukittu, heitetn
			nopat[i].heita();
		}
	}
}

public void lock(int ind){
	nopat[ind].lock();
}

public void unlock(){
	for(int i=0; i<5; i++){
		nopat[i].unlock();
	}
}

public Noppa[] getNopat(){
