public ArrayList<Yhdistelma> mahdollisetYhdistelmat(){
	Yhdistelma y = new Yhdistelma(kasi);
	ArrayList<Yhdistelma> yhdistelmat = y.getYhdistelmat(); // Kaikki kdest saatavat yhdistelmt
	ArrayList<Yhdistelma> toReturn = new ArrayList<Yhdistelma>(); // Palautettavat yhdistelmt
	for(int i=0; i<yhdistelmat.size(); i++){
		try{
			vihko.getPisteet(yhdistelmat.get(i).getNimi()); // Kokeillaan, onko vihkoon jo asetettu yhdistelmlle pisteet
		}
		catch(NoPointsException e){ // Yhdistelmlle ei ole viel asetettu pisteit, joten listn yhdistelm palautettaviin
			toReturn.add(yhdistelmat.get(i));
		}
	}
	Collections.sort(toReturn, Collections.reverseOrder()); // Jrjest yhdistelmt pisteiden mukaan laskevaan jrjestykseen
	return toReturn;
}

public String mahdollisetYhdistelmatToString(){
	String s="";
	ArrayList<Yhdistelma> y = mahdollisetYhdistelmat();
	int ind=y.size();
	for(int i=0; i<y.size(); i++){
		s=s+(i+1)+" - "+y.get(i).getNimi()+": "+y.get(i).getPisteet()+"p"+"\n";
		if(i==y.size()-1){
			s=s+"---------------------yliviivaa---------------------"+"\n";
		}
	}
	y=yliviivattavat();
	for(int i=0; i<y.size(); i++){
		s=s+(ind+i+1)+" - "+y.get(i).getNimi()+": "+y.get(i).getPisteet()+"p"+"\n";
	}
	return s;

}

public ArrayList<Yhdistelma> yliviivattavat(){
	Yhdistelma y = new Yhdistelma(kasi);
	ArrayList<Yhdistelma> yhdistelmat = y.getYhdistelmat(); // Kaikki kdest saatavat yhdistelmt
	ArrayList<Yhdistelma> toReturn = new ArrayList<Yhdistelma>(); // Palautettavat yhdistelmt
	for(int i=0; i<jatsiyhdistelmat.size(); i++){ // Kydn kaikki jatsiyhdistelmt lpi
		for(int j=0; j<yhdistelmat.size(); j++){ // Kydn kaikki kdest saatavat yhdistelmt lpi
			if(jatsiyhdistelmat.get(i)==yhdistelmat.get(j).getNimi()){ // Jos kdest on mahdollista saada ko. yhdistelm, ei list palautettaviin
				continue;
			}
			if(j==yhdistelmat.size()-1){ // Ollaan psty loppuun, eli kdest ei ole mahdollista saada ko. yhdistelm. Listn palautettaviin
				toReturn.add(new Yhdistelma(kasi.getNopat(), 0, jatsiyhdistelmat.get(i)));
			}

		}
	}
	for(int i=0; i<toReturn.size(); i++){
		try{
			vihko.getPisteet(toReturn.get(i).getNimi()); // Kokeillaan, onko vihkoon jo asetettu yhdistelmlle pisteet
			toReturn.remove(i); // On asetettu, joten poistetaan palautettavista
			i--;
		}
		catch(NoPointsException e){ // Yhdistelmlle ei ole viel asetettu pisteit, joten ei tehd mitn
		}
	}
	return toReturn;
}

