public String stringFormatoConstante(String str) {
	String x = str;
	for (int i = 0; i < x.length(); i++) {
		if (i>0 && Character.isUpperCase(x.charAt(i))){
			str = str.replace(x.charAt(i)+"", "_" + x.charAt(i));
		}				
	}
	return str;
}

