public  int InterceptLog(Connection conn,String user_name,String password,String filename,String directory,int lineNum) {
    Session session = null;
    int ret = -1;

    try {
        if (conn.authenticateWithPassword(user_name, password)) {  // 
            session = conn.openSession();               // 
        }
        System.out.println("username : " + user_name);
        System.out.println("password:  " + password);
        System.out.println("");

        session.execCommand("cd " + directory + ";" + "tail -"+lineNum +" " + filename);       //



        InputStream stdErr = new StreamGobbler(session.getStderr());
        InputStream stdOut = new StreamGobbler(session.getStdout());
        String line = null;
        BufferedReader brError = new BufferedReader(new InputStreamReader(stdErr, "utf-8"));
        BufferedReader brStdout = new BufferedReader(new InputStreamReader(stdOut, "utf-8"));

        while ((line = brError.readLine()) != null) {
            System.out.println(line);
        }
        while ((line = brStdout.readLine()) != null) {
            System.out.println(line);
        }
        ret = session.getExitStatus();
        session.close();
        conn.close();
        if (ret == 0) {
            System.out.println("");
        } else {
            System.out.println("");
        }
        return ret;

    } catch (IOException e) {
        e.printStackTrace();
    }
    return ret;
}

