public static int serializeAccount(int bank, int account) {
	if (bank > (int)(Math.pow(2,9) - 1)) {
		throw new 
		IllegalArgumentException("Le numero de banque est trop grand !");
	}
	if (account < 0 || account > getMaxAccount()) {
