        try {
            ps = conn.prepareStatement("SELECT * FROM " + mysqlTable
                    + " WHERE (type = 0 OR type = 1) AND (temptime > ? OR temptime = 0)");
            ps.setLong(1, System.currentTimeMillis() / 1000);
