            while (rs.next()) {
                EditBan e = getEditBan(rs);
                list.add(e);
            }
        } catch (SQLException ex) {
            FigAdmin.log.log(Level.SEVERE, "[FigAdmin] Couldn't execute MySQL statement: ", ex);
        } finally {
            try {
                if (ps != null)
