    Scanner s = new Scanner(list);
    Scanner s2 = new Scanner(whitelist);
    while (s.hasNextLine()) {
        main.blacklist.add(s.nextLine());
    }
    while (s2.hasNextLine()) {
        main.white.add(s2.nextLine());
    }
    s.close();
    s2.close();
}

