public boolean isValidExtension(String fileName)
{

	for (String s : extensions) {
		if(fileName.endsWith(s)) return true;
	}

	return false;
}

public boolean isValidSize(Long fileSize)
{
	if(fileSize<=maximumSize)return true;
	return false;
}

