public static boolean IsPrime(int n)
{
    double upper = Math.sqrt(n);

    if (upper < 2)
        return false;

    for (int i = 2; i <= upper; i++)
        if (n % i == 0)
            return false;

    return true;
}

public static String Primes(int n)
{
    String result = "";
    for (int i = 0; i <= n; i++)
        if (IsPrime(i))
            result += i + " ";

    return result;
}

