public double[][] forwardDCT(final float input[][]) {
    final double output[][] = new double[this.N][this.N];
    double tmp0, tmp1, tmp2, tmp3, tmp4, tmp5, tmp6, tmp7;
    double tmp10, tmp11, tmp12, tmp13;
    double z1, z2, z3, z4, z5, z11, z13;
    int i;
    int j;

    // Subtracts 128 from the input values
    for (i = 0; i < 8; i++) {
        for (j = 0; j < 8; j++) {
            output[i][j] = input[i][j] - 128.0;
            // input[i][j] -= 128;

        }
    }

    for (i = 0; i < 8; i++) {
        tmp0 = output[i][0] + output[i][7];
        tmp7 = output[i][0] - output[i][7];
        tmp1 = output[i][1] + output[i][6];
        tmp6 = output[i][1] - output[i][6];
        tmp2 = output[i][2] + output[i][5];
        tmp5 = output[i][2] - output[i][5];
        tmp3 = output[i][3] + output[i][4];
        tmp4 = output[i][3] - output[i][4];

        tmp10 = tmp0 + tmp3;
        tmp13 = tmp0 - tmp3;
        tmp11 = tmp1 + tmp2;
        tmp12 = tmp1 - tmp2;

        output[i][0] = tmp10 + tmp11;
        output[i][4] = tmp10 - tmp11;

        z1 = (tmp12 + tmp13) * 0.707106781;
        output[i][2] = tmp13 + z1;
        output[i][6] = tmp13 - z1;

        tmp10 = tmp4 + tmp5;
        tmp11 = tmp5 + tmp6;
        tmp12 = tmp6 + tmp7;

        z5 = (tmp10 - tmp12) * 0.382683433;
        z2 = 0.541196100 * tmp10 + z5;
        z4 = 1.306562965 * tmp12 + z5;
        z3 = tmp11 * 0.707106781;

        z11 = tmp7 + z3;
        z13 = tmp7 - z3;

        output[i][5] = z13 + z2;
        output[i][3] = z13 - z2;
        output[i][1] = z11 + z4;
        output[i][7] = z11 - z4;
    }

    for (i = 0; i < 8; i++) {
        tmp0 = output[0][i] + output[7][i];
        tmp7 = output[0][i] - output[7][i];
        tmp1 = output[1][i] + output[6][i];
        tmp6 = output[1][i] - output[6][i];
        tmp2 = output[2][i] + output[5][i];
        tmp5 = output[2][i] - output[5][i];
        tmp3 = output[3][i] + output[4][i];
        tmp4 = output[3][i] - output[4][i];

        tmp10 = tmp0 + tmp3;
        tmp13 = tmp0 - tmp3;
        tmp11 = tmp1 + tmp2;
        tmp12 = tmp1 - tmp2;

        output[0][i] = tmp10 + tmp11;
        output[4][i] = tmp10 - tmp11;

        z1 = (tmp12 + tmp13) * 0.707106781;
        output[2][i] = tmp13 + z1;
        output[6][i] = tmp13 - z1;

        tmp10 = tmp4 + tmp5;
        tmp11 = tmp5 + tmp6;
        tmp12 = tmp6 + tmp7;

        z5 = (tmp10 - tmp12) * 0.382683433;
        z2 = 0.541196100 * tmp10 + z5;
        z4 = 1.306562965 * tmp12 + z5;
        z3 = tmp11 * 0.707106781;

        z11 = tmp7 + z3;
        z13 = tmp7 - z3;

        output[5][i] = z13 + z2;
        output[3][i] = z13 - z2;
        output[1][i] = z11 + z4;
        output[7][i] = z11 - z4;
    }

    return output;
}

public double[][] forwardDCTExtreme(final float input[][]) {
    final double output[][] = new double[this.N][this.N];
    final double tmp0, tmp1, tmp2, tmp3, tmp4, tmp5, tmp6, tmp7;
    final double tmp10, tmp11, tmp12, tmp13;
    final double z1, z2, z3, z4, z5, z11, z13;
    final int i;
    final int j;
    int v, u, x, y;
    for (v = 0; v < 8; v++) {
        for (u = 0; u < 8; u++) {
            for (x = 0; x < 8; x++) {
                for (y = 0; y < 8; y++) {
                    output[v][u] += input[x][y] * Math.cos((double) (2 * x + 1) * (double) u * Math.PI / 16)
                            * Math.cos((double) (2 * y + 1) * (double) v * Math.PI / 16);
                }
            }
            output[v][u] *= 0.25 * (u == 0 ? 1.0 / Math.sqrt(2) : (double) 1.0)
                    * (v == 0 ? 1.0 / Math.sqrt(2) : (double) 1.0);
        }
    }
    return output;
}

private void initMatrix(final int quality) {
    final double[] AANscaleFactor = {
            1.0, 1.387039845, 1.306562965, 1.175875602, 1.0, 0.785694958, 0.541196100, 0.275899379 };
    int i;
    int j;
    int index;
    int Quality;
    int temp;

    // converting quality setting to that specified in the
    // jpeg_quality_scaling
    // method in the IJG Jpeg-6a C libraries

    Quality = quality;
    if (Quality <= 0) {
        Quality = 1;
    }
    if (Quality > 100) {
        Quality = 100;
    }
    if (Quality < 50) {
        Quality = 5000 / Quality;
    } else {
        Quality = 200 - Quality * 2;
    }

    // Creating the luminance matrix

    this.quantum_luminance[0] = 16;
    this.quantum_luminance[1] = 11;
    this.quantum_luminance[2] = 10;
