private void Order_codes() {
    // Order Codes Flow Chart C.3
    this.K = 0;

    while (true) {
        this.I = this.HUFFVAL[this.K];
        this.EHUFCO[this.I] = this.HUFFCODE[this.K];
        this.EHUFSI[this.I] = this.HUFFSIZE[this.K++];
        if (this.K >= this.LASTK) {
            break;
        }
    }
}

public HuffmanDecode(final byte[] data) {
    this.size = (short) data.length;
    this.dis = new DataInputStream(new ByteArrayInputStream(data));
    // Parse out markers and header info
    boolean cont = true;
    while (cont) {
        if (255 == getByte()) {
            switch (getByte()) {
            case 192:
                sof0();
                break;
            case 196:
                dht();
                break;
            case 219:
                dqt();
                break;
            case 217:
                cont = false;
                break;
            case 218:
                cont = false;
                break;
            case APP0:
            case APP1:
            case APP2:
            case APP3:
            case APP4:
            case APP5:
            case APP6:
            case APP7:
            case APP8:
            case APP9:
            case APP10:
            case APP11:
            case APP12:
            case APP13:
            case APP14:
            case APP15:
                skipVariable();
                break;
            case DRI:
                dri();
                break;
            }
        }
    }
}

