public void listen()
{
	client.send("", Client.CONNECT);
	new Thread(new Runnable() {
		public void run() {
			while(client.isRunning()) {
				synchronized (client) {
					DatagramPacket packet = client.receive();
					String msg = client.processPacket(packet);
					appendToConsole(msg);
				}
			}
		}
	}, "Client-Listener").start();
}

