	this.url = url;
}

	public void execute(CrawlerContext crawlerContext) throws IOException {
		Document doc = Jsoup.connect(url).get();      	
		Element nameElement = doc.select("#tombstone h1 *").first();
    	String playerName = fixString(nameElement.ownText());    	
