	            GL11.glVertex2f(x + 1, y + 0);
	            x += 8;
	         } else if (c == '.') {
	            GL11.glVertex2f(x + 1, y);
	            x += 2;
	         } else if (c == ',') {
	            GL11.glVertex2f(x + 1, y);
	            GL11.glVertex2f(x + 1, y + 1);
	            x += 2;
	         } else if (c == '\n') {
	            y -= 10;
	            x = startX;
	         } else if (c == ' ') {
	            x += 8;
	         }
	      }
	      GL11.glEnd();
	   }

