public void addEdge(GraphNode A, GraphNode B) {
	// set child graph node's parent to current graph node
	B.parent = A;

	// set child graph node's depth
	B.depth = (byte) (A.depth + 1);

	// add B as successor of A
	A.edges.addLast(B);
}

