        switch (dots) {
            case 1:
                return increaseDurationValue(1 / 2.0);

            case 2:
                return increaseDurationValue(1 / 2.0 + 1 / 4.0);

            case 3:
                return increaseDurationValue(1 / 2.0 + 1 / 4.0 + 1 / 8.0);
        }
    }

    return value.getDurationValue();
