public static boolean exists(File path, String reportName) {
	try {
		for(File file : path.listFiles()) {
			if(file.isFile() && file.getName().equals(reportName + ".jasper")) {
				return true;
			}
			if(file.isDirectory()) {
				return exists(file, reportName);
			}
		}
	} catch(Exception e) {
		e.printStackTrace();
	}
	return false;
}

