public static void loadReports(File path) {
	try {
		for(File file : path.listFiles()) {
			if(file.isFile() && file.getName().endsWith(".jasper")) {
				relatorios.add(new ReportFileUtil(file));
			}
			if(file.isDirectory()) {
				loadReports(file);
			}
		}
	} catch(Exception e) {
		e.printStackTrace();
	}
}

public static ReportFileUtil getReport(String reportName) {
	if(relatorios == null || relatorios.isEmpty()) {
		loadReports();
	}
	for(ReportFileUtil report : relatorios) {
		if(report.getCleanName().equals(reportName)) {
			return report;
		}
	}

	return null;
}

