private static int byteToInt(final byte b) {
    int i = b;
    if (b < 0) {
        i = 256 + b;
    }
    return i;
}

private static byte intToByte(final int i) throws Exception {
    if (i < 0 || i > 255) {
        throw new IllegalArgumentException("Invalid byte value " + i);
    }
    return (byte) i;
}

