public void print(int[] adm, String fromTo){
    this.fromTo = fromTo;

    this.five = adm[0];
    this.ten = adm[1];
    this.twenty = adm[2];
    this.game = adm[3];
    this.mgr = adm[4];
    this.comp = adm[5];
    this.door = adm[6];
    this.hotel = adm[7];

    PrinterJob job = PrinterJob.getPrinterJob();
    PageFormat pf = new PageFormat();

    Paper paper = new Paper();
    paper.setImageableArea(0, 0, 200, 1000);

    pf.setPaper(paper);

    Book book = new Book();
    book.append(this, pf);

    job.setPageable(book);

    try {
